1. We're talking about Aquaman here, a guy who lives underwater. Realism doesn't really enter the conversation here.

2. You can argue that it's "more realistic" (lol) but it also would have made for an entirely unwatchable solo Aquaman movie. Can you imagine if every time the characters wanted to speak to each other we either have to hear dolphin noises with subtitles or they have to make an air bubble?

@bluerisk Not the Amazons. The Amazons have been training and preparing for Steppenwolf and other foreign forces who tries to invade their land. They said that in the first Wonder Woman film. If you rewatch the scene, there are alot of Amazons guarding that place. They should've alerted Hippolyta as soon as the Motherboxes started waking up and she should've pre-positioned an army outside of the building they were holding their Motherbox in. Notice also the Geography and that the place where they kept the Motherbox is away from their actual living place. They have considered all the possibilities here except the fact that Steppenwolf has flying troops and that he can just use a boom tube in! This is umm only what they're preparing for for the last hundreds of years or whatever and they still failed. 

As for the Atlanteans, you would think it would be harder to locate their Motherbox. It would also be expected that they would be better equipped to keep their Motherbox safe as they are an advanced group of people and are very very intelligent! Not only was it poorly guarded, it was closer to the surface than I had imagined! Out of all the deepest and darkest places in the vast oceans, they picked a spot closer to the surface? It looks as if they entrusted Atlanteans to guard the Motherbox instead of Xebellians which would've been more apt as they are the more powerful breed. They have hydrokinesis among other abilites! 

Overall, I expected Steppenwolf to acquire the human's Motherbox first as it probably would've been the easiet. I was wrong. I was disappointed to see how weak the Amazons and the Atlanteans were shown here.
